import * as React from 'react';
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import IconButton from '@mui/material/IconButton';
import Typography from '@mui/material/Typography';
import NotificationsIcon from '@mui/icons-material/Notifications';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import MoreIcon from '@mui/icons-material/MoreVert';
import { styled } from '@mui/system';

const StyledAppBar = styled(AppBar)({
  background: '#ffffff', // Fondo blanco
  boxShadow: 'none', // Sin sombra para un estilo plano
});

const StyledToolbar = styled(Toolbar)({
  display: 'flex',
  justifyContent: 'space-between',
});

const StyledIconButton = styled(IconButton)({
  color: '#87CEFA', // Azul claro
  borderRadius: '50%', // Forma circular
  '&:hover': {
    background: 'rgba(135, 206, 250, 0.2)', // Cambiar el color al pasar el ratón
  },
});

const StyledTypography = styled(Typography)({
  fontSize: '16px', // Texto grande
  fontWeight: 'bold',
});

export default function BottomAppBar() {
  return (
    <StyledAppBar position="fixed">
      <StyledToolbar>
        <StyledIconButton size="large" edge="start" aria-label="open drawer">
          <MoreIcon />
        </StyledIconButton>
        <StyledTypography variant="h6" component="div">
          Tu Aplicación
        </StyledTypography>
        <StyledIconButton color="inherit">
          <NotificationsIcon />
        </StyledIconButton>
        <StyledIconButton color="inherit">
          <AccountCircleIcon />
        </StyledIconButton>
        <StyledIconButton edge="end" color="inherit">
          <MoreIcon />
        </StyledIconButton>
      </StyledToolbar>
    </StyledAppBar>
  );
}
